import { Button } from "@mui/material";
import React from "react";

const Home = () => {
  const submitData = (e) => {
    e.preventDefault;
  };

  return (
    <>
      <br /> <br />
      <Button variant="contained" onClick={(e) => submitData(e)}>
        SIGN IN
      </Button>
      <br /> <br />
      <Button variant="contained" onClick={(e) => submitData(e)}>
        SIGN IN
      </Button>
      <br /> <br />
      <Button variant="contained" onClick={(e) => submitData(e)}>
        SIGN IN
      </Button>
    </>
  );
};

export default Home;
